export default function Button_lg(props: any) {
  return (
    <Button
      size="lg"
      bg="$blue800"
      $hover-bg="$green50"
      $active-bg="$green900"
      color="$white"
    >
      <ButtonText>{props.name}</ButtonText>
    </Button>
  )
}
